import ContactItem from '../ContactItem/ContactItem';
import List from '../../lev3_4_projekt_js-reactjs_contacts.json';
import React, { useState } from 'react';

var result = [];

for (var i in List)
    result.push([i, List[0]]);

function ContactList() {
    const [choosenList, setList] = useState(result);
    console.log(choosenList);
    return (
        // <div></div>
        <ContactItem {...choosenList} />
    );
}

export default ContactList;
